import React, { Component } from 'react';
import {Layout, Menu, Icon, Avatar, Row, Col} from 'antd';
import 'antd/dist/antd.css';
import 'antd/dist/antd.min'
import qoobee from '../images/qoobee.jpg';

class Side extends Component{
    render(){
        return(

            <Layout style={{
                overflow: 'auto', height: '100vh', position: 'fixed', left: 0, width:'200px',
            }}
            >
                <Row theme="light" style={{backgroundColor:'pink'}}>
                    <Col span={8} offset={8}>
                        <Avatar size="large" src={qoobee} />
                    </Col>
                </Row>
                <Row type="flex" >
                    <Col  span={24} >
                        <Menu   mode="inline" defaultSelectedKeys={['1']} style={{backgroundColor:'pink'}}>
                            <Menu.Item key="1" >
                                <Icon type="user" />
                                <span className="nav-text">nav 1</span>
                            </Menu.Item>
                            <Menu.Item key="2">
                                <Icon type="video-camera" />
                                <span className="nav-text">nav 2</span>
                            </Menu.Item>

                            <Menu.Item key="7">
                                <Icon type="team" />
                                <span className="nav-text">nav 7</span>
                            </Menu.Item>
                            <Menu.Item key="8">
                                <Icon type="shop" />
                                <span className="nav-text">nav 8</span>
                            </Menu.Item>
                        </Menu>
                    </Col>

                </Row>
                <Layout style={{
                    left: 0, bottom:0
                }}
                >
                    <Menu align="middle" mode="inline" defaultSelectedKeys={['1']}>
                        <Menu.Item key="1" >
                            <Icon type="user" />
                            <span className="nav-text">nav 1</span>
                        </Menu.Item>
                    </Menu>
                </Layout>
            </Layout>
        );
    }
}
export default Side;
